import React from 'react';
import QuarterlyDashboard from './QuarterlyDashboard';
import AIDashboard from './components/AIDashboard'; // Add this import
import CountryDashboard from './CountryDashboard';
import RegionDashboard from './RegionDashboard';
import CustomerConcentration from './CustomerConcentration';

const DashboardRouter = ({ view }) => {
  switch (view) {
    case 'Quarterly': return <QuarterlyDashboard />;
    case 'Ask-AI': return <AIDashboard />; // Add this case
    default: return <p>Select a dashboard view.</p>;
  }
};

export default DashboardRouter;
